export default function FuturePlansBun() {
    var slideIndex = 0;
      showSlides();
      
    function showSlides() {
        var i;
        var slides = document.getElementsByClassName("mySlides");
        for (i = 0; i < slides.length; i++) {
          slides[i].style.display = "none"; 
        }
        slideIndex++;
        if (slideIndex > slides.length) {slideIndex = 1} 
        slides[slideIndex-1].style.display = "block"; 
        setTimeout(showSlides, 2000); // Change image every 2 seconds
    }
    return (<>
            <div className="slideshow-container">
            <div className="mySlides fade">
                <div className="numbertext">1 / 3</div>
                <img src="" className="w-full" />
                <div className="text">Лондон, Англия</div>
            </div>
            <div className="mySlides fade">
                <div className="numbertext">2 / 3</div>
                <img src="/uploads/media/default/0001/03/b7d624354d5fa22e38b0ab1f9b905fb08ccc6a05.jpeg" className="w-full" />
                <div className="text">Заход солнца в Румынии</div>
            </div>
            <div className="mySlides fade">
                <div className="numbertext">3 / 3</div>
                <img src="/uploads/media/default/0001/03/5bfad15a7fd24d448a48605baf52655a5bbe5a71.jpeg" className="w-full" />
                <div className="text">Нью-Йорк, США</div>
            </div>
            <a className="prev" onclick="plusSlides(-1)">&#10094;</a>
            <a className="next" onclick="plusSlides(1)">&#10095;</a>
            </div>
            <br></br>
            <div style="text-align:center">
                <span className="dot" onclick="currentSlide(1)"></span> 
                <span className="dot" onclick="currentSlide(2)"></span> 
                <span className="dot" onclick="currentSlide(3)"></span> 
            </div> 
    
            </>)}
